webpackJsonp([0xd1036e582cb],{4154:function(n,a){n.exports={data:{markdownRemark:{html:'<p><img src="https://danmaq.com/!/thC/thC_SS13.jpg" alt="クリックすると詳細を閲覧できます。"></p>\n<p><a href="/!/thC/">東方夢終劇R2.01パッチ</a>を公開します。v2.00で追加された余計なバグを潰す程度の効能です。</p>\n<h2>e-danmaq通販について</h2>\n<p><a href="https://www1n.sppd.ne.jp/danmaq.com/e-danmaq/index.cgi?type=cat&#x26;no=00001000001&#x26;sort=&#x26;begin=">夢終劇の未開封パッケージがまだ5こ程まだ残ってた</a>ので早いもの順でﾄﾞｿﾞｰ中身はとらのあな委託版と同じR1.02となっております。(<a href="/!/thC/">夢終劇ページより最新パッチを当てることが出来ます</a>)この5こがたぶんラストなのではけたら6/6納品で再プレス注文したのでそれまで待ちになります。</p>\n<h2>例大祭について</h2>\n<p>例大祭はごめんなさい完全に一般参加です。何らかの電波を期待していた方々にはお詫び申し上げます。</p>\n<h2>とりあえず今年いっぱいの短期計画</h2>\n<ul>\n<li>danmaqサイトの改装、(内部的に)blog化</li>\n<li>時封城v2.00(っと言っても時封城v2でやりたいことの9割5分方夢終劇v2まででやりつくしちゃったから作るかどうかびみょい)</li>\n<li>夢終劇体験版D(夢終劇v2の機能制限版・お試しLWセット)</li>\n<li>夏なんかやりたい(やっぱ一般参加じゃカッコつかないぜ？)</li>\n<li>シンセ立ち上げてごにょごにょ中</li>\n<li>本だしたいな</li>\n<li>時間いくらあっても足りんがな（´・ω・｀）</li>\n<li>冗談のつもりだったがこりゃ東方でやりたいこと全部やろうとしたら本気で5年くらいかかりそうな悪寒</li>\n</ul>',frontmatter:{cover:null,date:"2007-05-12T21:47:00+09:00",strDate:"2007/5/12",title:"さーて、ゆとりがなくなってきたぞー"}}},pathContext:{path:"/ja/blog/2007/05/12-さーて、ゆとりがなくなってきたぞー/",langKey:"ja"}}}});
